import react from 'react'
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from "@material-ui/core/Container";
import Link from "@material-ui/core/Link";
import Grid from '@material-ui/core/Grid';


const useStyles = makeStyles(theme => ({
  footer: {
    background:'black',
    color: 'silver',
    
    fontFamily: 'Lora, "Times New Roman", Times, Baskerville, Georgia, serif',
    '& a': {
      color: 'silver'
    }
  },
  mainText: {
    fontFamily: '"Montserrat","Arial","Helvetica Neue","Helvetica",sans-serif !important',
    color: 'white'
  },
  subtext: {
    fontFamily: 'Lora, "Times New Roman", Times, Baskerville, Georgia, serif',
    fontSize: "12px"
  },
  hot: {
    color: "#00ffe7"
  },
  topFooter: {
    padding: '40px 0',
  },
  bottomFooter: {
    padding: '15px 0',
    background: "#003d37",
    fontSize: "10px"
  },
  bottomText:{
    fontSize: "10px"
  },
  contact: {
    textAlign: 'right'
  }
  }));
  
  
function Copyright() {
  const classes = useStyles();
  return (
    <Typography variant="body2"  align="center" className={classes.bottomText}>
      {"Copyright Â© "}{" "} {new Date().getFullYear()} - {" "}
      <Link color="inherit" href="https://hottofind.com/">
        https://hottofind.com
      </Link>
        </Typography>
  );
}


const Footer = props => {
  const classes = useStyles();

  return (
<footer className={classes.footer}>
  <div className={classes.topFooter}>
<Container maxWidth="lg" spacing={3}>
<Grid container>
<Grid item sm={4}>
  <div className={classes.company}>
  <Typography variant="h6"  gutterBottom className={classes.mainText}>
    <span className={classes.hot}>HotToFind</span> Australia
  </Typography>
  <Typography variant="subtitle1"  component="p" className={classes.subtext}>
    Free Local Classifieds - Buy / Sell / Trade anything
  </Typography>
  </div>
  </Grid>
  <Grid item sm={2}>

  </Grid>
  <Grid item sm={2}>
    <div className={classes.links}>
      <a href="/posts/employment">Jobs</a><br/>
      <a href="/posts/local-places">Local</a><br/>
      <a href="/posts/community">Community</a><br/>
      <a href="/posts/automotive">Auto</a><br/>

      
    </div>

    </Grid>
    <Grid item sm={2}>
    <div className={classes.links}>
      <a href="/posts/real-estate-selling">Realty - Buy</a><br/>
      <a href="/posts/real-estate-renting">Realty - Rent</a><br/>
      <a href="/posts/services">Services</a><br/>
      <a href="/posts/adult">Adult</a><br/>

      
    </div>
    </Grid>
  <Grid item sm={2}>
    <div className={classes.contact}>
<a href="mailto:info@hottofind.com">info@hottofind.com</a>
<p>1 George St, <br/> Sydney  NSW  2000</p>
<a href="https://hottofind.com">https://hottofind.com</a>
</div>
    </Grid>
  </Grid>

</Container>
</div>
<div className={classes.bottomFooter}>
<Container maxWidth="lg">
<Copyright />
  </Container>
</div>
</footer>
  )
}

export default Footer
